    {
        /* Table lookup helpers */
        size_t posleft, posright, posmiddle;
        /* Storage for data points */
        double xi[LIP_ORDER];
        double yi[LIP_ORDER];
        /* Loop index */
        int i;

        /* Sanity check nucleus */
        if (Z < 1) return 0.0;
        if (Z >= SAP_NELEM) return 0.0;
        /* Sanity check for radius */
        if (x <= 0.0) return Zeff[Z][0];
        if (x >= Zeff[0][SAP_NRAD - 1]) return Zeff[Z][SAP_NRAD - 1];

        /* Figure out where we are in the x array using a binary search */
        posleft = 0;
        posright = SAP_NRAD - 1;
        while (1) {
            posmiddle = (posleft + posright) / 2;
            if (Zeff[0][posmiddle] < x)
                posleft = posmiddle;
            else if (Zeff[0][posmiddle] > x)
                posright = posmiddle;
            else if (Zeff[0][posmiddle] == x)
                return Zeff[Z][posmiddle];

            if (posleft + 1 == posright) break;
        }

        /* Obtain result with a Lagrange interpolating polynomial.
           Do we have an array overrun? */
        if (posleft + LIP_ORDER - 1 >= SAP_NRAD) posleft -= (posleft + LIP_ORDER) - SAP_NRAD;

        /* Copy data */
        for (i = 0; i < LIP_ORDER; i++) {
            xi[i] = Zeff[0][posleft + i];
            yi[i] = Zeff[Z][posleft + i];
        }

        /* Lagrange interpolation */
        {
            /* Lagrange polynomial */
            double li;
            /* Loop indices */
            size_t i, j;
            /* Result */
            double y = 0.0;
            /* Loop over polynomials */
            for (i = 0; i < LIP_ORDER; i++) {
                /* Evaluate the polynomial */
                li = 1.0;
                for (j = 0; j < LIP_ORDER; j++) {
                    if (i == j) continue;
                    li *= (x - xi[j]) / (xi[i] - xi[j]);
                }
                /* Increment function value */
                y += yi[i] * li;
            }

            return y;
        }
    }
